import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "./TopRated.css";
import { Pagination } from "swiper/modules";
import MovieCard from "../components/Main/MainTopRated/MovieCard";

const TopRated = () => {
  return (
    <>
      <Swiper
        slidesPerView={4}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide key={Date.now()}>
          <MovieCard key={movie.imdbID} imdbID={movie.imdbID} />
        </SwiperSlide>
      </Swiper>
    </>
  );
};
